package com.labwinner.vo;

import java.util.List;

import com.labwinner.domain.Reaction;
import com.labwinner.domain.ReactionProcess;

public class ReactionProcessCopyVo {
	
	private List<ReactionProcess> reactionProcesses;
	
	private Reaction reaction;

	public ReactionProcessCopyVo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public ReactionProcessCopyVo(List<ReactionProcess> reactionProcesses,
			Reaction reaction) {
		super();
		this.reactionProcesses = reactionProcesses;
		this.reaction = reaction;
	}

	public List<ReactionProcess> getReactionProcesses() {
		return reactionProcesses;
	}

	public void setReactionProcesses(List<ReactionProcess> reactionProcesses) {
		this.reactionProcesses = reactionProcesses;
	}

	public Reaction getReaction() {
		return reaction;
	}

	public void setReaction(Reaction reaction) {
		this.reaction = reaction;
	}
     
}
